"""Сравнивая графики, можем сделать вывод, что распределение оценок не изменилось после предобработки. Также получившийся график очень похож на график нормального распределения, что подтверждает одну из выдвинутых гипотез. 
 ![image.png](data:image/png;base64,)

   
   
 Сравнивать рейтинги закнченных и незаконченных аниме не получится, так как по результатам первой описательной статистики на этапе предобработки незаконченные аниме были удалены, как выбросы. Теперь посмотрим на распределение возрастного рейтинга аниме.
"""

rating_data = {rating: df["rating"].to_list().count(rating) for rating in set(df["rating"])}
cases = []
rating = []
for rate, cases_num in rating_data.items():
  if rate == 0:
    rating.append("G - All Ages")
    cases.append(cases_num)
    continue
  if rate == 7:
    rating.append("PG - Children")
    cases.append(cases_num)
    continue
  if rate == 13:
    rating.append("PG-13 - Teens 13 or older")
    cases.append(cases_num)
    continue
  if rate == 17:
    rating.append("R - 17+ (violence & profanity")
    cases.append(cases_num)
  if rate == 18:
    rating.append("R+ - Mild Nudity")
    cases.append(cases_num)
  if rate == 21:
    rating.append("Rx - Hentai")
    cases.append(cases_num)

types_info = pd.DataFrame({"сases": cases,"rating": rating})
types_info.head()

fig = go.Figure()
fig.add_trace(go.Pie(values=cases, labels=rating))

"""Распределение возрастного рейтинга почти не изменилось, но аниме для всех возрастов стало больше, так как в эту категорию также вошли аниме, для которых было указано отсутствие возрастного рейтинга.
Дальше посмотрим, как изменилась диаграмма длительности аниме. 
"""

duration_data = {duration: df["duration"].to_list().count(duration) for duration in set(df["duration"])}
cases = []
durations = []
for duration, cases_num in duration_data.items():
    if "hr" in duration or duration == "Unknown":
      continue
    if float(duration) <1:
      continue
    if cases_num>500:
      durations.append(int(duration))
      cases.append(cases_num)

fig = go.Figure()
fig.add_trace(go.Pie(values=cases, labels=durations))

"""В целом, после обработки солбца duration распределение значений не сильно изменилось, однако выявлено было достаточно большое количество аниме с сериями по три минуты. Это может быть связано с тем, что в изначальном датасете значения были не структурированны, и одно и то же значение могло называться по разному (3 min, 3 minutes, 3 min per ep и тд). Такое большое количество коротких аниме можно объяснить наличием аниме, сделанного по ёнкомам, а также невозможностью производить длинные аниме на ранних этапах развития индустрии.

Теперь проверим распределение по жанрам.
"""

temp = df.genres.str.split(",")
import functools
import operator
unique_genres = list(functools.reduce(operator.concat, temp))
unique_genres.sort()
num = 0
for item in unique_genres:
  if "[" in item:
    item = item.replace('[','')
  if "]" in item:
    item = item.replace(']','')
  item = item.replace(' ','')
  unique_genres[num] = item
  num = num+1
print(unique_genres)

from collections import Counter
s = Counter(unique_genres)
s = dict(s)
sorted_dict = {}
sorted_keys = sorted(s, key=s.get)
for w in sorted_keys:
    sorted_dict[w] = s[w]
delete_list = []
for i in sorted_dict:
    if sorted_dict[i] < 1000:
        delete_list.append(i)
for each in delete_list:
    del sorted_dict[each]
genres_data = pd.DataFrame.from_dict(sorted_dict, orient="index", columns=["cases"])
genres_data['genres'] = genres_data.index
genres_data

f, ax = plt.subplots(figsize=(10, 6))
sns.barplot(data=genres_data, x="cases", y = "genres", orient = 'h')

