"""Как видно из графика, распределение почти не изменилось, однако добавился большой столбец с неизвестными данными. На предыдущей диаграмме его не было, потому что вместо слова Unknown ыбли пустые значения, которые не учитывались при подсчете. Остальные значения кажутся довольно малыми и можно подумать, что неизвестные значения занимают большую часть датасета, но это не так: на самом деле это связано с тем, что студий очень много (в получившемся во время анализа датафрейме 499 строк). 
Теперь посмотрим, изменилось ли распределение аниме по десятилетиям после того, как часть даты была обрезана. 
"""

dates_list = {name: df["aired_from"].to_list().count(name) for name in df["aired_from"].unique()}
ntens = 0
ntws = 0
nths = 0
nfs = 0
nfivs = 0
nsixs = 0
nsevs = 0
neights = 0
nnines = 0
tzeros = 0
ttens = 0
ttws = 0
for date, cases_num in dates_list.items():
  if date >= 1910 and date < 1920: ntens = ntens+cases_num
  if date >= 1920 and date < 1930: ntws = ntws+cases_num
  if date >= 1930 and date < 1940: nths = nths+cases_num
  if date >= 1940 and date < 1950: nfs = nfs+cases_num
  if date >= 1950 and date < 1960: nfivs = nfivs+cases_num
  if date >= 1960 and date < 1970: nsixs = nsixs+cases_num
  if date >= 1970 and date < 1980: nsevs = nsevs+cases_num
  if date >= 1980 and date < 1990: neights = neights+cases_num
  if date >= 1990 and date < 2000: nnines = nnines+cases_num
  if date >= 2000 and date < 2010: tzeros = tzeros+cases_num
  if date >= 2010 and date < 2021: ttws = ttws+cases_num
year_dict = dict({"1910s":ntens,"1920s":ntws,"1930s":nths,"1940s":nfs,"1950s":nfivs,"1960s":nsixs,"1970s":nsevs,"1980s":neights, "1990s":nnines, "2000s":tzeros,"2010s":ttws})

year_data = pd.DataFrame.from_dict(year_dict, orient="index", columns=["cases"])
year_data['years'] = year_data.index
year_data.head()

sns.lineplot(x="years", y="cases", data=year_data)

